mooie film

met Jesse Bradford, Elisha Cuthbert en Jay Patterson

De eenzame Charlie Bellow (Jesse Bradford) komt uit een klein dorpje in Midden Amerika. Zijn eenzaamheid is voorbij wanneer hij 
verliefd wordt op Jordan Roark (Elisha Cuthbert). Ze heeft een aantal vreemde karaktertrekjes waardoor ze samen in de problemen 
komen.
